      SELECT col2 * 20 + + 26 + + ( - col0 ) / + + col0 * col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NULL NOT BETWEEN NULL AND - col2 / + CAST ( - 12 AS INTEGER );
  - name: tab2

outputs:
  - name: q9837.out
    data: |
